import React from 'react';
import logo from './logo.svg';
import './App.css';

class FeedUrlForm extends React.Component {

  handleClick(event) {
    console.log(event.target.value);
  }

  render() {
    return (
      <div>
        <label>Enter feed url: </label>
        <form className="feed-url-form">
          <input type="text" name="feed-url"></input>
          <input type="submit" value="Submit" onClick={this.handleClick()}/>
        </form>
      </div>
    );
  }
}


function App() {
  return (
    <FeedUrlForm />

  );
}

export default App;
